import { BarChart,Bar,Rectangle,XAxis,YAxis,CartesianGrid,Tooltip,Legend } from "recharts";

function Bars ({input}) {
    let data = input

    return (
        <BarChart width={500}
        height={300}
        data={data}
        margin={{
        top: 5,
        right: 30,
        left: 20,
        bottom: 5,
        }}>
            <CartesianGrid strokeDasharray="3 3"/>
            <XAxis dataKey="day"/>
            <YAxis/>
            <Tooltip />
            <Legend />
            <Bar dataKey="kilogram" fill="#282D30" radius={[10,10,0,0]} width={7} activeBar={<Rectangle fill="#282D30" stroke="#282D30" />} />
            <Bar dataKey="calories" fill="#E60000" radius={[10,10,0,0]} width="7px" activeBar={<Rectangle fill="#E60000" stroke="#E60000" />} />
        </BarChart>
    )
}

export default Bars
